@w2 <color=#ffffff>[L]</color> Хмм. @w2 Ок. @w2 Тогда наслаждайтесь пребыванием. @w2 Я настраиваю заключительные процедуры. @w2 Или вы хотите сразу их переписать?
@w2 <color=#9c9c9c>[M]</color> Не стоит беспокоиться. @w2 Вроде не было проблем с переносом графика, да?@p9 <color=#ffffff>[L]</color> Э-э, @w2 кхм, @w2 Нет. @w2 Конечно. @w2 Команды добились исключительных успехов с тех пор, как какой-то офисный работник решил выбросить их из кроватей. @w2 Это, после того, как уже работают недели практически без сна.
@w2 <color=#9c9c9c>[M]</color> Очевидно, это риск работы во флоте экспедиции, верно?
@w2 <color=#ffffff>[L]</color> Ха ха. @w2 Скажу вот что, вся эта «экспедиция» идет странным маршрутом. @w2 Не говоря уже о том, что есть Совет, который принимает все решения, а UCH почему-то в неведении. @w2 Вам не кажется, что это требует дополнительных ... @w2 объяснений?
@p9 <color=#9c9c9c>[M]</color> Нет. Что мы должны объяснить? @w2 Кому? @w2 Для всех участников экспедиции нет ничего секретного. @w2 Мы расскажем людям то, что им нужно знать.
@w2 <color=#ffffff>[L]</color> Да. Это именно моя точка зрения! Как вы, наверное, знаете, мой дедушка был ведущим инженером на Hyperion. @w2 Он не потерялся с кораблем только по одной простой причине: кто-то решил перенести свою смену. @w2 Я благодарен ему за это, но дедушке так и не удалось избавиться от клейма «оставшегося труса».
@p9 <color=#ffffff>[L]</color> Мой отец переехал со мной на Марс после внезапной смерти моего дедушки. @w2 Я записался во флот сразу после колледжа, чтобы показать, на что способна наша семья. @w2 Папа сказал, что дедушка сошел с ума от этого дерьма. @w2 Продажные чиновники просто хотят всех заставить замолчать. @w2 Особенно одна личность и организация Hyperion Bereaved. @w2 Все его рассказы о «спланированной аварии». @w2 Корабль «не будет уничтожен» и некая «угроза», с которой мы столкнемся - все это очень драматично.
@p9 <color=#ffffff>[L]</color> И, честно говоря, до последних 24 часов я всегда думал, что этот бедный старик просто не справился с тем, что случилось. @w2 Когда вы оказались на борту Титана, я вдруг вспомнил одну из сказок моего дедушки про какие-то «черные костюмы» посетившие Гиперион за несколько дней до миссии.
@w2 <color=#9c9c9c>[M]</color> Командир. Пожалуйста...
@w2 <color=#ffffff>[L]</color> Я тебе вот что скажу: 
@p9 <color=#ffffff>[L]</color> Я работаю над этим проектом почти восемь лет, и последние несколько месяцев я смотрел на этот проект и считал. @w2 За последнюю неделю и, в частности, за последние 24 часа, произошло столько странных вещей.@w2 Знаете ли вы, что на борту Гранд и ТИТАН есть несколько отделений морпехов? Я проверил манифесты вчера. @w2 Мы припрятали тонны, тонны и тонны боеприпасов большого калибра. @w2 Я инженер. Я знаю, для чего созданы эти формулы и материалы. @w2 Это не для защиты от астероидов. @w2  И вот вы поднимаетесь на борт. @w2 И первое, что вы делаете, - это возитесь с протоколами, которые я разрабатывал последние пять лет.
@p9 <color=#9c9c9c>[M]</color> Внесенные нами корректировки основаны на важных данных, поступающих непосредственно из лабораторий Апполон. @w2 Доктор Грейсон и доктор Доусон?
@w2 <color=#ffffff>[L]</color>Я знаю. @w2 Но я также посмотрел на внесенные вами изменения. @w2 Это рискованно. Я не уверен, что они точно должны делать. @w2 Похоже, у них нет какой-либо функции, улучшающей эффективность варп-двигателей.
@w2 <color=#9c9c9c>[M]</color> Будьте уверены, они были одобрены ведущими специалистами, так что все в порядке.
@w2 <color=#ffffff>[L]</color> Будьте уверены, что если что-то пойдет не так .. @w2 и кто-то пострадает .. @w2 и я обнаружу, что это произошло из-за ваших изменений .. @w2 ничем хорошим это не закончится .. @w2 для вас.

