English:
This whole operation seems to have had totally different goals than the ones the teams were told. @w2 The official story was, we would be going on a short trip to Proxima Centauri to get more Pentaxid to help Earth survive. 

@w2 The fleet left the Jupiter orbit - forced by the Waverider Protocol as it seems - and ended up billions of light years beyond that point! @w2 In Andromeda! @p9 The irregular Vortex we were dragged into might have been the reason for the passage to Andromeda. 

@w2 A wavefront, which pushed us further than the warp drives could ever have achieved alone. @w2 It seems like this was finely planned up to the very second. @w2 Although I'm not sure if our little one-year delay was planned as well or just an accident either. @p9 Anyways. @w2 As far as we know, the fleet was attacked immediately upon arrival here .. @w2 which makes me think, those Zirax were waiting for them. @w2 Or they simply ended up in a galactic hornet's nest,  where everyone is pretty nervous. @w2 Shoot first, ask later. @w2 

Similar things might have happened before. @w2 Not sure if the council knew about that .. @w2 but they armed the fleet as much as possible.

Russian:
Похоже, что вся эта операция преследовала совершенно другие цели, чем те, о которых говорили командам. @w2 По официальной версии, мы собираемся совершить короткое путешествие на Проксиму Центавра, чтобы получить больше пентаксида, чтобы помочь Земле выжить. 

@w2 Флот покинул орбиту Юпитера - по-видимому, вынужденный протоколом Waverider - и оказался на миллиарды световых лет дальше этой точки! @w2 В Андромеде! @p9 Необычный Вихрь, в который мы были втянуты, мог быть причиной перехода к Андромеде. 

@w2 Волновой фронт, который продвинул нас дальше, чем могли бы когда-либо достичь варп-двигатели в одиночку. @w2 Похоже, это было хорошо спланировано с точностью до секунды. @w2 Хотя я не уверен, была ли наша небольшая годичная отсрочка тоже запланирована или это просто несчастный случай. @p9 В любом случае. @w2 Насколько нам известно, флот был атакован сразу по прибытии сюда .. @w2 что наводит на мысль, что эти Зиракс ждали их. @w2 Или просто попали в гнездо галактического шершня, где все очень нервничают. @w2 Сначала стреляй, потом спрашивай. @w2 

Подобные вещи могли случиться и раньше. @w2 Не уверен, знал ли совет об этом .. @w2 но они вооружили флот настолько, насколько это возможно.

