@w2 Если я смогу привести их в действие хотя бы на несколько минут, мы сможем отправить экстренное сообщение. 
@p9 Но это будет означать, что Зиракс отправит на эту позицию все, что у них есть. Учитывая близлежащие военные объекты, у вас останется всего несколько минут, чтобы подготовиться к ним. @w2 <color=#ffffff>Лучше сражатьься с ними на своем корабле</color>, чем пешком. 

@w2 В любом случае. Вам нужно <color=#fbff00>удерживать эти войска в течении нескольких минут</color>, пока антенна не завершит передачу сигнала.

English:
Hello my friend! @w2 I am happy to see you still alive ... @w2 This is kind of an urgent call. @w2 We have received some alarming info @w2 ..about the Legacy! @w2 Seems there is more behind it as we hoped.  

@w2 Long story short: @w2 We heard from Polaris officials that they've lost one of their capital vessels - @w2 the Ilmarinen.
@p9 The vessel was exploring distant systems for the last few years. @w2 It's goal was to find new worlds and new resources. @w2 The company lost contact with the ship about half a year ago. @w2
They have found its trace, @w2 but because of the Zirax patrols getting much more frequent in the months since your people's arrival, @w2 they are not able to officially investigate themselves. @w2 Now they are asking if we could lend them a hand.

Russian:
Здравствуй, друг мой! @w2 Я счастлив видеть тебя живым ... @w2 Это своего рода срочный звонок. @w2 Мы получили тревожную информацию @w2 ..о Наследии! @w2 Кажется, что за этим стоит нечто большее, как мы и надеялись.  

@w2 Короче говоря: @w2 Мы слышали от официальных лиц Полярис, что они потеряли одно из своих основных судов. - @w2 Ilmarinen.
@p9 Судно исследовало далекие системы последние несколько лет.. @w2 Его целью было найти новые миры и новые ресурсы. @w2 Компания потеряла связь с кораблем около полугода назад. @w2
Они нашли его след, @w2 но из-за того, что патрули Зиракса становятся все более частыми в месяцы после прибытия ваших людей, @w2 они не могут провести официальное расследование. @w2 Теперь они спрашивают, можем ли мы им помочь.

English:
Ilmarinen Exploration Crew, 
@w2 2nd Commander Fract'alite. 

@w2 THIS IS a WARNING to the pilot approaching this station! 
@w2 Hold your distance, pick up this message and relay it to the Polaris HQ! 
@w2 The Ilmarinen is heading for this planet, but it is not under our control! 
@p9 To anyone who is reading this: @w2 Code Omega! @w3 DESTROY that whole ship! 
@w2 We picked something up, which killed the entire crew and took control of the ship. @w2 We managed to survive long enough to find this station and send this recorded warning, @w2 but no doubt we are already dead. @w2 Do not search for survivors. 
@p9 I repeat: @w4 DESTROY that ship and this station as well with the strongest weapons you have! @w2 Do NOT leave even dust! 
@p9 I am so sorry. @w2 Chief SaintJohn was absolutely right from the beginning. @w2 
We might have revived the dark times. 

@w2 May the galaxy forgive us ..

