Исследовательская группа Ilmarinen, 
@w2 2-й командир Fract'alite. 

@w2 ЭТО ПРЕДУПРЕЖДЕНИЕ пилоту, приближающемуся к этой станции! 
@w2 Держитесь подальше, возьмите это сообщение и передайте его в штаб-квартиру Полярис! 
