@p9 
Для всех, кто читает это: @w2 Код Omega! @w3 УНИЧТОЖЬТЕ этот корабль! 
@w2 Мы что-то подобрали, в результате чего весь экипаж погиб и корабль взяли под контроль. @w2 Нам удалось выжить достаточно долго, чтобы найти эту станцию и отправить это записанное предупреждение, @w2, но, без сомнения, мы уже мертвы. @w2 Не ищите выживших. 
@p9 Я повторяю: @ w4 УНИЧТОЖЬТЕ этот корабль и эту станцию самым сильным оружием, которое у вас есть! @w2 НЕ оставляйте даже пыли! 
@p9 Мне очень жаль. @w2 Шеф Сент-Джон был абсолютно прав с самого начала. @w2 Возможно, мы возродили темные времена. @w2 Да простит нас галактика ..

English:
Mission day 503. @w2 
Log entry 280 
Message to the Captain 
@p9 This mess happening in Hangar B is getting out of control, Frank! @w2 The wreckage has lost ... @w2 weight ... @w2 and even mass, which seems crazy. @w2 Spilling some substance all over the floor. @w2 We have sealed the doors, but I doubt this will keep this slippery stuff inside. @w2 As our lead scientist told me, the wreckage they picked up was covered in a biological substance, which seems to moulder due to the changed atmospheric parameters. @w2 Really great. 
@w2 Can you guys guess who's getting assigned to the cleaning squad?

Ah, I see.. @w2 sorry for the confusion. @w2 You received our once-in-a-lifetime offer to participate in our product evaluation program to test the BEST SELLING low-gravity brewed root beer in Andromeda! 

@w2 Each new version is promised to be bug free and thoroughly tested. 3 out of 4 in our latest focus group survived the tasting! @p9  A friend of yours has suggested you would be a perfect candidate for our new product testing. @w2 

But, I am afraid we need to inform you, the TOP Distillery freighter did not arrive on time. @w2  Given all the minefields, Pirates and the Zirax patrols. @w4 We fear the worst. @w9  @w2 It might be a bit unconventional, but may I ask you for a favor?

Russian:
Ах, я вижу.. @w2 извините за путаницу. @w2 Вы получили наше уникальное предложение поучаствовать в нашей программе оценки продукции, чтобы протестировать БЕСТСЕЛЛЕР низкогравитационного рутбира в Андромеде! 

@w2 Обещано, что каждая новая версия будет без ошибок и тщательно протестирована. 3 из 4 участников нашей последней фокус-группы пережили дегустацию! @p9  Ваш друг предположил, что вы будете идеальным кандидатом для тестирования нашего нового продукта. @w2 

Но, боюсь, нам нужно сообщить вам, что грузовое судно TOП Винокурня не прибыло вовремя. @w2  Учитывая все минные поля, патрули Пиратов и Зиракса. @w4 Мы опасаемся худшего. @w9  @w2 Это может быть немного необычно, но могу я попросить вас об одолжении?

